import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
const [showPassword, setShowPassword] = useState(false); // ðŸ‘ Toggle password
const [rememberMe, setRememberMe] = useState(false);     // âœ… Remember Me


const LoginBox: React.FC = () => {
  const navigate = useNavigate();// âœ… This creates the navigate function
  const [activeTab, setActiveTab] = useState("user");

  // Common states
  const [error, setError] = useState("");

  // User states
  const [userEmail, setUserEmail] = useState("");
  const [userPassword, setUserPassword] = useState("");

  // Admin states
  const [adminUsername, setAdminUsername] = useState("");
  const [adminPassword, setAdminPassword] = useState("");

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    setError(""); // Reset error

    if (activeTab === "user") {
      if (!userEmail || !userPassword) {
        setError("Please enter both email and password for user login.");
        return;
      }
      if (userEmail !== "user@example.com" || userPassword !== "password123") {
        setError("Invalid email or password.");
        return;
      }
      // âœ… On success, navigate to UserInterface
      navigate("/userdashboard"); 
      // Proceed with user login
      console.log("User login with:", userEmail, userPassword);
    } else {
      if (!adminUsername || !adminPassword) {
        setError("Please enter both admin username and password.");
        return;
      }
      // Proceed with admin login
      console.log("Admin login with:", adminUsername, adminPassword);
    }
  };

  return (
    <div className="min-h-screen bg-indigo-50 flex justify-center items-center px-4">
      <div className="w-full max-w-md bg-white rounded-2xl shadow-xl overflow-hidden">
        <div className="bg-indigo-600 p-6">
          <h2 className="text-2xl font-bold text-white mb-1">Login to Quizoraa</h2>
          <p className="text-indigo-100 text-sm">Access your account to participate in contests</p>
        </div>

        <div className="px-6 pt-4 pb-6">
          <div className="flex justify-center space-x-6 mb-6 border-b border-gray-200">
            <button
              className={`py-2 font-semibold text-sm ${activeTab === "user" ? "text-indigo-600 border-b-2 border-indigo-600" : "text-gray-500"}`}
              onClick={() => {
                setActiveTab("user");
                setError("");
              }}
            >
              User Login
            </button>
            <button
              className={`py-2 font-semibold text-sm ${activeTab === "admin" ? "text-indigo-600 border-b-2 border-indigo-600" : "text-gray-500"}`}
              onClick={() => {
                setActiveTab("admin");
                setError("");
              }}
            >
              Admin Login
            </button>
          </div>

          <form className="flex flex-col space-y-4" onSubmit={handleSubmit}>
            {error && (
              <div className="text-red-600 text-sm font-medium">{error}</div>
            )}

            {activeTab === "user" ? (
              <>
                <label className="font-medium text-sm">Email Address</label>
                <input
                  type="email"
                  value={userEmail}
                  onChange={(e) => setUserEmail(e.target.value)}
                  placeholder="Enter email"
                  className="p-3 border border-gray-300 rounded-lg text-sm"
                />

                <label className="font-medium text-sm">Password</label>
                <input
                  type="password"
                  value={userPassword}
                  onChange={(e) => setUserPassword(e.target.value)}
                  placeholder="Enter password"
                  className="p-3 border border-gray-300 rounded-lg text-sm"
                />

                <div className="flex justify-between items-center text-sm">
                  <label className="flex items-center gap-2">
                    <input
                      type="checkbox"
                      className="h-4 w-4 accent-indigo-600"
                    />
                    Remember me
                  </label>
                  <a href="/forgetpassword" className="text-indigo-600 hover:underline">Forgot password?</a>
                </div>

                <button
                  type="submit"
                  className="bg-indigo-600 hover:bg-indigo-700 text-white font-bold py-2 rounded-lg mt-2"
                >
                  Login
                </button>

                <p className="text-center text-sm mt-4">
                  Don't have an account? <a href="/register" className="text-indigo-600 hover:underline">Register now</a>
                </p>
              </>
            ) : (
              <>
                <label className="font-medium text-sm">Admin Username</label>
                <input
                  type="text"
                  value={adminUsername}
                  onChange={(e) => setAdminUsername(e.target.value)}
                  placeholder="Enter admin ID"
                  className="p-3 border border-gray-300 rounded-lg text-sm"
                />

                <label className="font-medium text-sm">Password</label>
                <input
                  type="password"
                  value={adminPassword}
                  onChange={(e) => setAdminPassword(e.target.value)}
                  placeholder="Enter password"
                  className="p-3 border border-gray-300 rounded-lg text-sm"
                />

                <button
                  type="submit"
                  className="bg-indigo-600 hover:bg-indigo-700 text-white font-bold py-2 rounded-lg mt-2"
                >
                  Login as Admin
                </button>
              </>
            )}
          </form>
        </div>
      </div>
    </div>
  );
};

export default LoginBox;
